import React, { useState, useRef, useEffect } from "react";
import Swal from "sweetalert2";

function Add({ employees, setEmployees, setIsAdding }) {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [salary, setSalary] = useState("");
  const [date, setDate] = useState("");
  const [position, setPosition] = useState("");
  const textInput = useRef(null);

  useEffect(() => {
    textInput.current.focus();
  }, []);

  const handleAdd = (e) => {
    e.preventDefault();
    if (!firstName || !lastName || !email || !salary || !date || !position) {
      return Swal.fire({
        icon: "error",
        title: "Error!",
        text: "All fields are required.",
        showConfirmButton: true,
      });
    }

    const id = employees.length + 1;
    const newEmployee = {
      id,
      firstName,
      lastName,
      email,
      salary,
      date,
      position,
    };
    employees.push(newEmployee);
    setEmployees(employees);
    setIsAdding(false);

    Swal.fire({
      icon: "success",
      title: "Added!",
      text: `${firstName} ${lastName}'s data has been Added.`,
      showConfirmButton: false,
      timer: 1500,
    });
  };

  // const positions = {
  //   CEO: {
  //     CTO: {
  //       "Project Manager": {
  //         "Product Owner": {
  //           "Tech Lead": {
  //             "Frontend Developer": null,
  //             "Backend Developer": null,
  //             "DevOps Engineer": null,
  //           },
  //         },
  //         "QA Engineer": null,
  //         "Scrum Master": null,
  //         // ...
  //       },
  //     },
  //     CFO: {
  //       "Chef Accountant": {
  //         "Financial Analyst": null,
  //         "Account and Payable": null,
  //       },
  //       "Internal Audit": null,
  //     },
  //     COO: {
  //       "Product Manager": null,
  //       "Operation Manager": null,
  //       "Customer Relation": null,
  //       // ...
  //     },
  //     HR: null,
  //   },
  // };

  // const renderPositions = (positions) => {
  //   return Object.entries(positions).map(([position, children]) => {
  //     if (children) {
  //       return (
  //         <optgroup key={position} label={position}>
  //           {renderPositions(children)}
  //         </optgroup>
  //       );
  //     } else {
  //       return (
  //         <option key={position} value={position}>
  //           {position}
  //         </option>
  //       );
  //     }
  //   });
  // };

  return (
    <div className="small-container">
      <form onSubmit={handleAdd}>
        <h1>Add Employee</h1>
        <label htmlFor="firstName">First Name</label>
        <input
          id="firstName"
          type="text"
          ref={textInput}
          name="firstName"
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
        />
        <label htmlFor="lastName">Last Name</label>
        <input
          id="lastName"
          type="text"
          name="lastName"
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
        />
        <label htmlFor="email">Email</label>
        <input
          id="email"
          type="email"
          name="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <label htmlFor="salary">Salary ($)</label>
        <input
          id="salary"
          type="number"
          name="salary"
          value={salary}
          onChange={(e) => setSalary(e.target.value)}
        />
        <label htmlFor="date">Date</label>
        <input
          id="date"
          type="date"
          name="date"
          value={date}
          onChange={(e) => setDate(e.target.value)}
        />
        <label htmlFor="position">Position</label>
        <select
          id="position"
          name="text"
          value="position"
          onChange={(e) => setPosition(e.target.value)}
        >
          {/* <option value="">Select a Position</option> */}
          {/* {renderPositions(positions)} */}
        </select>
        <div style={{ marginTop: "30px" }}>
          <input type="submit" value="Add" />
          <input
            style={{ marginLeft: "12px" }}
            className="muted-button"
            type="button"
            value="Cancel"
            onClick={() => setIsAdding(false)}
          />
        </div>
      </form>
    </div>
  );
}

export default Add;
